import React, { Component } from "react";
import { Navlink } from "react-router"

const Home = () => {
  return (
    <>
      <div className="text-center">
        <h1 className="pt-5 text-danger font-weight-bold">
          Welcome to Online Shopping Store
        </h1>
        <Navlink to="/store" />
      </div>
    </>
  );
};

export default Home;
